import ExpenseDate from '../Expenses/ExpenseDate'
import '../Expenses/Expenseitem';
import Card from '../UI/card';
import ExpenseFilter from '../ExpenseFilter/ExpenseFilter';


const Expenseitem = (props) => {
const [title,setstate]  =useState(props.title);
 const clicked = function(){
 setstate('Updated')
 }
  return ( 
    <div>
    <ExpenseFilter/>
    <Card className="expense-item"> 
      <ExpenseDate thatDay={props.thatDay}/>
      <div className="expense-item__description">
        <h2>{title}</h2>
        <div className="expense-item__price">${props.rate}</div>
      </div>
      <button className="btn-trial" onClick = {clicked}>Change Title</button>
    </Card>
    </div>

   );
}
export default Expenseitem;
